import React from 'react';
import Api from "../utils/Api";
import { MDBDataTable, MDBTableBody, MDBTableHead } from 'mdbreact';

const DatatablePage = () => {

  let userData = getusers();

  const data = {
    columns: [
      {
        label: 'Image',
        field: 'Image',
        sort: 'asc',
        width: 150
      },
      {
        label: 'Name',
        field: 'Name',
        sort: 'asc',
        width: 270
      },
      {
        label: 'Phone',
        field: 'Phone',
        sort: 'asc',
        width: 200
      },
      {
        label: 'Email',
        field: 'Email',
        sort: 'asc',
        width: 100
      },
      {
        label: 'DOB',
        field: 'DOB',
        sort: 'asc',
        width: 150
      }
    ],
    rows: Api.getusers().then(results=>{return results})

  };

  return (
    <MDBDataTable
      striped
      bordered
      large
      data={data}
    />
  );
}

export default DatatablePage;
